style.css:
@-moz-document domain("discord.com") {
/* Change the background color of the main app */
  .appMount-3lHmkl {
    background-color: #2c2f33 !important;
  }

  /* Customize the sidebar */
  .container-3baos1 {
    background-color: #23272a !important;
  }

  /* Change the color of server names */
  .name-1jkAdW {
    color: #99aab5 !important;
  }

  /* Customize channel names */
  .name-2SL4ev,
  .name-28HaxV {
    color: #b9bbbe !important;
  }

  /* Change the background and text color of messages */
  .message-2qnXI6 {
    background-color: #36393f !important;
    color: #dcddde !important;
  }

  /* Customize the chat input area */
  .textArea-2Spzkt {
    background-color: #40444b !important;
    color: #dcddde !important;
  }

  /* Change the appearance of buttons */
  .button-38aScr,
  .button-1cRKG6 {
    background-color: #7289da !important;
    color: #ffffff !important;
    border: none !important;
    border-radius: 4px !important;
    padding: 10px 20px !important;
    cursor: pointer !important;
  }

  /* Change the hover state of buttons */
  .button-38aScr:hover,
  .button-1cRKG6:hover {
    background-color: #5b6eae !important;
  }

  /* Customize the footer */
  .footer-1fjuF6 {
    background-color: #23272a !important;
    color: #99aab5 !important;
    padding: 20px !important;
  }

  /* Change the color of links */
  .anchor-3Z-8Bb {
    color: #7289da !important;
  }

  /* Change the hover state of links */
  .anchor-3Z-8Bb:hover {
    color: #5b6eae !important;
  }
}
